(window.webpackJsonp=window.webpackJsonp||[]).push([[65],{564:function(module,__webpack_exports__,__webpack_require__){"use strict";eval('__webpack_require__.r(__webpack_exports__);\n/* harmony default export */ __webpack_exports__["default"] = ("<h1 id=\\"ant-design-of-san\\"><span>Ant Design of San</span><a href=\\"#ant-design-of-san\\" class=\\"anchor\\">#</a></h1><p>这里是 Ant Design 的 San 实现，开发和服务于企业级后台产品。</p><h2 id=\\"特性\\"><span>特性</span><a href=\\"#特性\\" class=\\"anchor\\">#</a></h2><ul>\\n<li>提炼自企业级中后台产品的交互语言和视觉风格。</li>\\n<li>开箱即用的高质量 San 组件。</li>\\n<li>共享<a href=\\"http://ant-design.gitee.io/docs/spec/introduce-cn\\">Ant Design of React</a>设计工具体系。</li>\\n</ul>\\n<h2 id=\\"支持环境\\"><span>支持环境</span><a href=\\"#支持环境\\" class=\\"anchor\\">#</a></h2><ul>\\n<li>现代浏览器和 IE9 及以上（需要 <a href=\\"https://vue.ant.design/docs/vue/getting-started-cn/#%E5%85%BC%E5%AE%B9%E6%80%A7\\">polyfills</a>）。</li>\\n<li>支持服务端渲染。</li>\\n</ul>\\n<h2 id=\\"安装\\"><span>安装</span><a href=\\"#安装\\" class=\\"anchor\\">#</a></h2><h3 id=\\"使用-npm-安装\\"><span>使用 npm 安装</span><a href=\\"#使用-npm-安装\\" class=\\"anchor\\">#</a></h3><p>我们推荐使用 npm 的方式进行开发，不仅可在开发环境轻松调试，也可放心地在生产环境打包部署使用，享受整个生态圈和工具链带来的诸多好处。</p><pre><code>$ npm install santd --save</code></pre><p>如果你的网络环境不佳，推荐使用 <a href=\\"https://github.com/cnpm/cnpm\\">cnpm</a>。</p><h3 id=\\"浏览器引入\\"><span>浏览器引入</span><a href=\\"#浏览器引入\\" class=\\"anchor\\">#</a></h3><p>在浏览器中使用 <code>script</code> 和 <code>link</code> 标签直接引入文件，并使用全局变量 santd。</p><p>我们在 npm 发布包内的 santd/dist 目录下提供了 <code>santd.js</code> <code>santd.css</code> 以及 <code>santd.min.js</code> <code>santd.min.css</code>。</p><blockquote>\\n<p>强烈不推荐使用已构建文件，这样无法按需加载，而且难以获得底层依赖模块的 bug 快速修复支持。</p></blockquote>\\n<blockquote>\\n<p>注意：引入 santd.js 前你需要自行引入 san 和 moment。</p></blockquote>\\n<h2 id=\\"示例\\"><span>示例</span><a href=\\"#示例\\" class=\\"anchor\\">#</a></h2><pre><code class=\\"language-javascript\\">import {DatePicker} from &#39;santd&#39;;\\nconst App = san.defineComponent({\\n    components: {\\n        &#39;s-datepicker&#39;: DatePicker\\n    },\\n    template: &#39;&lt;div&gt;&lt;s-datepicker /&gt;&lt;/div&gt;&#39;\\n});</code></pre>\\n<p>引入样式：</p><pre><code class=\\"language-javascript\\">import &#39;santd/dist/santd.css&#39;;</code></pre>\\n<h3 id=\\"按需加载\\"><span>按需加载</span><a href=\\"#按需加载\\" class=\\"anchor\\">#</a></h3><p>下面两种方式都可以只加载用到的组件。</p><ul>\\n<li>使用 babel-plugin-import（推荐）。</li>\\n</ul>\\n<pre><code class=\\"language-javascript\\">{\\n    loader: &#39;babel-loader&#39;,\\n    options: {\\n        plugins: [[&#39;import&#39;, {\\n            libraryName: &#39;santd&#39;,\\n            libraryDirectory: &#39;es&#39;,\\n            style: &#39;css&#39;\\n        }]]\\n    }\\n}</code></pre>\\n<p>然后只需从 santd 引入模块即可，无需单独引入样式。等同于下面手动引入的方式。</p><pre><code class=\\"language-javascript\\">// babel-plugin-import 会帮助你加载 JS 和 CSS\\nimport { DatePicker } from &#39;santd&#39;;</code></pre>\\n<ul>\\n<li>手动引入</li>\\n</ul>\\n<pre><code class=\\"language-javascript\\">import DatePicker from &#39;santd/es/date-picker&#39;;\\nimport &#39;santd/es/date-picker/style&#39;;</code></pre>\\n<h2 id=\\"如何贡献\\"><span>如何贡献</span><a href=\\"#如何贡献\\" class=\\"anchor\\">#</a></h2><p>如果你希望参与贡献，欢迎 <a href=\\"https://github.com/ecomfe/santd/pulls\\">Pull Request</a>。</p><blockquote>\\n<p>强烈推荐阅读 <a href=\\"https://github.com/ryanhanwu/How-To-Ask-Questions-The-Smart-Way\\">《提问的智慧》</a>、<a href=\\"https://github.com/seajs/seajs/issues/545\\">《如何向开源社区提问题》</a> 和 <a href=\\"http://www.chiark.greenend.org.uk/~sgtatham/bugs-cn.html\\">《如何有效地报告 Bug》</a>、<a href=\\"https://zhuanlan.zhihu.com/p/25795393\\">《如何向开源项目提交无法解答的问题》</a>，更好的问题更容易获得帮助。</p></blockquote>\\n");\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///564\n')}}]);